import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input using its placeholder and type to trigger autocomplete
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.type('phone', { delay: 100 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_in_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_in_search.png'));

    // 2. Wait for the suggestions container to be visible
    // The suggestions are dynamically added in a div with class 'search-suggestions'
    await page.waitForSelector('.search-suggestions', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // 3. Get the text of the first suggestion and click it
    const firstSuggestion = page.locator('.suggestion-item').first();
    const suggestionText = await firstSuggestion.textContent();
    if (!suggestionText) {
        throw new Error('Could not retrieve text from the first suggestion item.');
    }
    await firstSuggestion.click();

    // 4. Verify the search input value has been updated with the suggestion
    const finalInputValue = await searchInput.inputValue();
    if (finalInputValue.trim() !== suggestionText.trim()) {
      throw new Error(`Search input value mismatch. Expected: "${suggestionText.trim()}", Got: "${finalInputValue.trim()}"`);
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_suggestion_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_suggestion_selected.png'));

    return {
      success: true,
      action: "Successfully tested the search autocomplete functionality by typing, waiting for suggestions, and selecting an option.",
      extractedData: {
        selectedSuggestion: suggestionText.trim(),
        finalSearchValue: finalInputValue.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
